"use strict";(self.webpackChunkdevdocs=self.webpackChunkdevdocs||[]).push([[77386],{38810:function(e){e.exports=JSON.parse('{"label":"Translation","permalink":"/devdocs/general/tags/translation","allTagsPath":"/devdocs/general/tags","count":12,"items":[{"id":"development/process/translation/amos","title":"AMOS manual","description":"AMOS stands for Automated Manipulation Of Strings. AMOS is a central repository of Moodle strings and their history. It tracks the addition of English strings into Moodle code, gathers translations, handles common translation tasks and generates language packages to be deployed on Moodle servers.","permalink":"/devdocs/general/development/process/translation/amos"},{"id":"development/process/translation/contributing","title":"Contributing a translation","description":"The Translation site enables translators to work collaboratively on language packs using a special Moodle translation tool called AMOS. If you see an error or non-translated term in Moodle in your language, you can contribute a correction or translation via the Translation site.","permalink":"/devdocs/general/development/process/translation/contributing"},{"id":"development/process/translation/langpack/locales","title":"Locales","description":"Locale is a set of parameters that defines the user\'s language, country and any special variant preferences that the user wants to see in their user interface. Usually a locale identifier consists of at least a language identifier and a region identifier.","permalink":"/devdocs/general/development/process/translation/langpack/locales"},{"id":"development/process/translation/maintaining","title":"Maintaining a language pack","description":"Volunteering to become a language pack maintainer","permalink":"/devdocs/general/development/process/translation/maintaining"},{"id":"development/process/translation/langpack/index","title":"Starting a new language pack","description":"If Moodle is not yet translated into your language and you would like to help, please  create an account on the Translation site and contact our Moodle translation coordinator through translation@moodle.org.","permalink":"/devdocs/general/development/process/translation/langpack/"},{"id":"development/process/translation/moodleapp","title":"Translating Moodle App","description":"The Moodle App is being translated into more and more languages! Check out the latest translation stats.","permalink":"/devdocs/general/development/process/translation/moodleapp"},{"id":"development/process/translation/docs","title":"Translating Moodle Docs","description":"Contributing to the documentation","permalink":"/devdocs/general/development/process/translation/docs"},{"id":"development/process/translation/plugins","title":"Translating plugins","description":"Looking for translated plugins in the Moodle plugins database","permalink":"/devdocs/general/development/process/translation/plugins"},{"id":"development/process/translation","title":"Translation","description":"So you\'d like to help with translating Moodle?","permalink":"/devdocs/general/development/process/translation"},{"id":"development/process/translation/faq","title":"Translation FAQ","description":"How can I help with translating Moodle?","permalink":"/devdocs/general/development/process/translation/faq"},{"id":"development/process/translation/langpack/langconfig","title":"Translation langconfig","description":"Langconfig is an important file in a language pack, dealing with all the configuration parameters of that language. It is good practice to review this first when starting of a new language pack or when taking on responsibility of an existing language pack. You can edit it by going to lang.moodle.org and find it as the core_langconfig component for your language.","permalink":"/devdocs/general/development/process/translation/langpack/langconfig"},{"id":"development/process/translation/langpack/priority","title":"Translation priority","description":"This page gives a letter based priority grade to every file or file group in a language pack. The aim is to help new language packs to reach as quickly as possible a usable state.","permalink":"/devdocs/general/development/process/translation/langpack/priority"}]}')}}]);